from django.db import modelsfrom goods_map.stock.models import StockModel, MarketModelclass GoodsModel(models.Model):    name = models.CharField(max_length=50)    cost_price = models.PositiveSmallIntegerField(null=True)    wholesale_price = models.PositiveSmallIntegerField(null=True)    retail_price = models.PositiveSmallIntegerField(null=True)    weight = models.FloatField(null=True)    market = models.ForeignKey(MarketModel, on_delete=models.PROTECT,                               related_name='market', null=True)    stock = models.ManyToManyField(StockModel)    def __str__(self):        return self.name